const TextInput = ({divId, placeholderText}) => {

    const nameStyle = {
        position: 'absolute',
        alignSelf: 'center',
        fontSize: '15pt',
        fontFamily: "'Varela Round', sans-serif",
        textAlign: 'center',
        top: '290px',
        height: '50px',
        width: '250px',
        marginBottom: '25px',
        borderRadius: '25px',
        borderColor: 'rgba(0,0,0,0)',
        backgroundColor: '#ebe09f',
        zIndex: '10',
      };

      const placeholderStyle = {
        textAlign: 'center',
      };

      const selectionStyle = {
        backgroundColor: 'rgb(173, 121, 210)',
        color: 'white',
      };

      const focusStyle = {
        outline: 'none',
      };

      return (
        <input
        id={divId}
        type="text"
        placeholder={placeholderText}
        maxLength="12"
        style={nameStyle}
        placeholderStyle={placeholderStyle}
        selectionStyle={selectionStyle}
        focusStyle={focusStyle}
      />
      );

    // <input id="name-input" type="text" placeholder="Enter Kitten Name" maxLength="12"/>
}

export default TextInput;
